import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css"; // ✅ Make sure this is imported correctly

ReactDOM.render(<App />, document.getElementById("root"));

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
